    "text" : "Late to the discussion, but a big part of the problem is funding. Sponsors and funders much more likely to fund a project for girls than they are for women. Plenty of people want to work on this - I am one of them - but it's very difficult to convince funders to pony up. https:\/\/t.co\/rF2Dop9LXT",
